import React, { useState } from 'react';
import './SplitCategory.css'; // Ensure this CSS is properly linked

const SplitCategory = () => {
  const [category, setCategory] = useState('Travel');
  const [expenseName, setExpenseName] = useState('');
  const [amount, setAmount] = useState('');
  const [friends, setFriends] = useState('');
  const [expenses, setExpenses] = useState({
    Travel: [],
    'Food & Dining': [],
    Home: [],
  });

  const handleAddExpense = () => {
    if (expenseName && amount && friends) {
      const friendList = friends.split(',').map((friend) => friend.trim());
      const splitAmount = parseFloat(amount) / friendList.length;

      setExpenses((prevExpenses) => {
        return {
          ...prevExpenses,
          [category]: [
            ...prevExpenses[category],
            { name: expenseName, amount: parseFloat(amount), friendList, splitAmount },
          ],
        };
      });

      setExpenseName('');
      setAmount('');
      setFriends('');
    }
  };

  const handleCategoryChange = (e) => {
    setCategory(e.target.value);
  };

  return (
    <div className="split-category-container">
      <h2>Split Expenses by Category</h2>

      {/* Dropdown to select category */}
      <div className="category-select">
        <label>Select Category:</label>
        <select value={category} onChange={handleCategoryChange}>
          <option value="Travel">Travel</option>
          <option value="Food & Dining">Food & Dining</option>
          <option value="Home">Home</option>
        </select>
      </div>

      {/* Input for expense name and amount */}
      <div className="expense-input">
        <label>Expense Name:</label>
        <input
          type="text"
          value={expenseName}
          onChange={(e) => setExpenseName(e.target.value)}
          placeholder="e.g., Dinner, Taxi"
        />
      </div>
      <div className="expense-input">
        <label>Amount:</label>
        <input
          type="number"
          value={amount}
          onChange={(e) => setAmount(e.target.value)}
          placeholder="Amount in ₹"
        />
      </div>

      {/* Input for friends or phone numbers */}
      <div className="expense-input">
        <label>Friends/Phone Numbers (comma separated):</label>
        <input
          type="text"
          value={friends}
          onChange={(e) => setFriends(e.target.value)}
          placeholder="Friend 1, Friend 2, Phone Number"
        />
      </div>

      {/* Button to add expense */}
      <button className="add-expense-btn" onClick={handleAddExpense}>
        Add Expense
      </button>

      {/* Display categorized expenses with split information */}
      <div className="categorized-expenses">
        {Object.keys(expenses).map((cat) => (
          <div key={cat} className="category">
            <h3>{cat}</h3>
            <table>
              <thead>
                <tr>
                  <th>Expense</th>
                  <th>Amount (₹)</th>
                  <th>Split Among</th>
                  <th>Split Amount (₹)</th>
                </tr>
              </thead>
              <tbody>
                {expenses[cat].map((expense, index) => (
                  <tr key={index}>
                    <td>{expense.name}</td>
                    <td>{expense.amount}</td>
                    <td>{expense.friendList.join(', ')}</td>
                    <td>{expense.splitAmount.toFixed(2)}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        ))}
      </div>
    </div>
  );
};

export default SplitCategory;
